// Some functions based off of fair-atomic-swap/src/atomicswap/eip2266/ERC2266Swap.sol
// Copyright (c) 2019 Chris Haoyu LIN, Runchao HAN, Jiangshan YU
// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./libraries/token/ERC20/ERC20.sol";

//TODO: use SafeMath
//TODO: this follows the ordering of the diagram given in the paper. It does NOT allow for Bob to
// start the swap on the Apricot Chain. We need to make it work two ways.

//TODO: get Monitoring directory back on

//TODO: add state to everything

//How does correctness of policy depend on Delta?
//Save Delta as Constant and then we can toy with it

//Generate different tracelogs for different deltas

contract TwoPartySwapBanana {

    //TODO: emit State in final events
    //Monitor won't go into details of contract being refuned. These enums will act as flags. 
    //These signify that something happened. Variable are all flags 

    //TODO: get something that logs files
    enum State { Empty, Filled, AssetRedeemed, AssetRefunded, PremiumRefunded}

    /**
     * The ApricotSwap struct keeps track of participants and swap details
     */
    struct ApricotSwap {
        //participants
        address payable alice;
        address payable bob;
        bytes32 hashLock;
        address assetName;
    }

    /**
     * The Escrow struct keeps track of the escrowed Asset
     */
    struct Escrow {
        //type of asset 
        uint expected;
        uint current;
        //the deadline is for escrowing 
        uint deadline;
        //the timeout is for redeeming
        uint timeout;
        State state;
    }
    /**
     * The Premium struct keeps track of the deposited premium.
     */
    struct Premium {
        uint expected;
        uint current;
        uint deadline;
        State state;
    }

    /**
     * Mappings that store our swap details.
     */
    mapping(bytes32 => ApricotSwap) public swaps;
    mapping(bytes32 => Escrow) public escrows;
    mapping (bytes32 => Premium) public premiums;

    //If all goes well, this contract will emit:
    // 1) SetUp (call made by Alice)
    // 2) PremiumDeposited (call made by Bob)
    // 3) AssetEscrowed (call made by Alice)
    // 4) AssetRedeemed (call made by Bob)

    //Say that Alice never escrows her Apricots. This contract will emit:
    // 1) SetUp (call made by Alice)
    // 2) PremiumDeposited (call made by Bob)
    // Bob will then collect Alice's premium on the Banana Blockchain, which is premiumAlice + premiumBob

    //Now, say that Bob never sends the preimage of the hashlock. This contract will emit:
    // 1) SetUp (call made by Alice)
    // 2) PremiumDeposited (call made by Bob)
    // 3) AssetEscrowed (call made by Alice)
    // 4) AssetRefunded (call made by Alice)
    // 5) PremiumRedeemed (call made by Alice)
    // Alice gets her asset back AS WELL AS Bob's premium. She also needs to get her premium refunded on the Banana chain

    /**
     * On setup, we need to know the hashlock and participants.
     */
    event SetUp(
        uint timestamp,
        bytes32 hashLock,
        address payable alice,
        address payable bob
    );

    /**
     * Once Alice deposits her premium, we want to check that she deposited the correct amount.
     */
    event PremiumDeposited(
        uint timestamp,
        uint premiumAmount,
        State state
    );

    /**
     * Once Bob escrows his asset, we want to check that he escrowed the correct amount.
     */
    event AssetEscrowed (
        uint timestamp,
        uint assetAmount,
        State state
    );

    /**
     * If the swap succeeds, Alice will collect her asset.
     */
    event AssetRedeemed(
        uint timestamp,
        State state
    );

    /**
     * If the swap fails, Bob will redeem Alice's premium after the timout deadline.
     */
    event PremiumRedeemed(
        uint timestamp,
        State state
    );

    /**
     * If the swap fails, Bob can get his asset back after the timout deadline.
     */
    event AssetRefunded(
        uint timestamp,
        State state
    );


    modifier canSetup(bytes32 hashLock) {
        require(escrows[hashLock].state == State.Empty);
        require(premiums[hashLock].state == State.Empty);
        _;
    }

    modifier canDepositPremium(bytes32 hashLock) {
        require(msg.sender == swaps[hashLock].alice);
        require(premiums[hashLock].state == State.Empty);
        require(ERC20(swaps[hashLock].assetName).balanceOf(msg.sender) >= premiums[hashLock].expected);
        require(block.timestamp <= premiums[hashLock].deadline, "did not escrow premium in time");
        _;
    }

    modifier canEscrowAsset(bytes32 hashLock) {
        require(msg.sender == swaps[hashLock].bob);
        require(premiums[hashLock].state == State.Filled);
        require(escrows[hashLock].state == State.Empty);
        require(ERC20(swaps[hashLock].assetName).balanceOf(msg.sender) >= escrows[hashLock].expected);
        require(block.timestamp <= escrows[hashLock].deadline, "did not escrow asset in time");
        _;
    }

    modifier canRedeemAsset(bytes32 preimage, bytes32 hashLock) {
        require(msg.sender == swaps[hashLock].alice);
        require(block.timestamp <= escrows[hashLock].deadline);
        require(sha256(abi.encodePacked(preimage)) == hashLock);
        _;
    }

    modifier canRefundAsset(bytes32 preimage, bytes32 hashLock) {
        require(msg.sender == swaps[hashLock].bob);
        require(sha256(abi.encodePacked(preimage)) == hashLock);
        require(block.timestamp > escrows[hashLock].timeout);
        _;
    }


    modifier canRedeemPremium(bytes32 hashLock) {
        require(msg.sender == swaps[hashLock].bob);
        require(block.timestamp > escrows[hashLock].timeout);
        _;
    }

    function setup(uint expectedEscrowBob,
                    uint expectedPremiumAlice,
                    address payable alice,
                    address payable bob,
                    address assetName,
                    bytes32 hashLock)
        public payable canSetup(hashLock) {

        //set up swap mapping
        swaps[hashLock].hashLock = hashLock;
        swaps[hashLock].assetName = assetName;
        swaps[hashLock].alice = alice;
        swaps[hashLock].bob = bob;

        //set up escrow mapping
        escrows[hashLock].expected = expectedEscrowBob;
        //TODO: set these timeouts
        escrows[hashLock].deadline = 0;
        escrows[hashLock].timeout = 0;

        //set up premium mapping
        premiums[hashLock].expected = expectedPremiumAlice;
        //TODO: set this timeout
        premiums[hashLock].deadline = 0;

        emit SetUp(
            block.timestamp,
            hashLock,
            alice,
            bob
        );
    }

    // From source: will also need to call tokenB.approve(this_contract_address, premiumAmount) in advance
    // removed parameter because unused: uint256 premiumRefundTime
    function depositPremium(bytes32 hashLock)
    public
    payable
    canDepositPremium(hashLock)
    {
        ERC20(swaps[hashLock].assetName).transferFrom(swaps[hashLock].alice, address(this), premiums[hashLock].expected);
        premiums[hashLock].current = premiums[hashLock].expected;
        premiums[hashLock].state = State.Filled;

        emit PremiumDeposited(
            block.timestamp,
            premiums[hashLock].current,
            premiums[hashLock].state
        );
    }

    // removed parameter because unused: uint refundTime
    function escrowAsset(bytes32 hashLock) public payable canEscrowAsset(hashLock) {
        ERC20(swaps[hashLock].assetName).transferFrom(swaps[hashLock].bob, address(this), escrows[hashLock].expected);
        escrows[hashLock].current = escrows[hashLock].expected;
        escrows[hashLock].state = State.Filled;

        emit AssetEscrowed(
            block.timestamp,
            escrows[hashLock].current,
            escrows[hashLock].state
        );
    }

    function redeemAsset(bytes32 preimage, bytes32 hashLock) public canRedeemAsset(preimage, hashLock) {
        ERC20(swaps[hashLock].assetName).transferFrom(address(this), swaps[hashLock].alice, escrows[hashLock].current);

        emit AssetRedeemed(
            block.timestamp,
            State.AssetRedeemed
        );
    }

    function refundAsset(bytes32 preimage, bytes32 hashLock) public canRedeemAsset(preimage, hashLock) {
        ERC20(swaps[hashLock].assetName).transferFrom(address(this), swaps[hashLock].bob, escrows[hashLock].current);

        emit AssetRefunded(
            block.timestamp,
            State.AssetRefunded
        );
    }

    function redeemPremium(bytes32 hashLock) public canRedeemPremium(hashLock){
        ERC20(swaps[hashLock].assetName).transferFrom(address(this), swaps[hashLock].bob, escrows[hashLock].current);

        emit PremiumRedeemed(
          block.timestamp, 
          State.PremiumRefunded
        );
    }
